immutable-object-update
Simple and fast immutable update utility.

full documentation can be found on https://andres-kovalev.github.io/immutable-object-update/

Description
immutable-object-update provides simple utilities for immutable object update (pretty helpful for reducers).
Installation
As any other npm package immutable-object-update can be added to your project by following command:
npm i -S immutable-object-update

API
There are several operations provided by this package:

set(object, path, value)
update(object, path, updater)
remove(object, path)

Most of operations consumes at least 2 arguments:

object to be updated
path to updated element

The 2nd argument might be an array of items or dot-separated string.
import { set } from 'immutable-object-update';

const state = {
    a: {
        a1: 1,
        a2: 2
    },
    b: {
        b1: 3,
        b2: 4
    }
};

const updated = set(state, [ 'b', 'b1' ], 5);

// or

const updated = set(state, 'b.b1', 5);

As a result we will receive new object with structure below:
{
    a: {
        a1: 1,
        a2: 2
    },
    b: {
        b1: 3,
        b2: 5
    }
}

New object will keep the same refs when necessary:
state === updated // false
state.a === updated.a // true (structure of a hasn't changed)
state.a.a1 === updated.a.a1 // true
state.a.a2 === updated.a.a2 // true
state.b === updated.b // false
state.b.b1 === updated.b.b1 // true
state.b.b2 === updated.b.b2 // false

When using string as 2nd argument - dot will be considered as a delimiter (e.g. a.b means field b of field a). So, it's not possible to update keys which contains dots with string type path:
const updated = set({
    'a.b': 1,
    a: {
        b: 2
    }
}, 'a.b', 3);

/*
{
    'a.b': 1,
    a: {
        b: 3
    }
}
*/

If you need to update such keys, use array type path instead:
const updated = set({
    'a.b': 1,
    a: {
        b: 2
    }
}, [ 'a.b' ], 3);

/*
{
    'a.b': 3,
    a: {
        b: 2
    }
}
*/

Utility also ignores empty path (e.g. a..b equal to a.b) and will create intermediate fields by itself when needed:
const updated = set({}, 'a.b', 10);

/*
{
    a: {
        b: 10
    }
}
*/

It can even create new objects when no source object provided:
const updated = set(undefined, 'a.b', 10);

/*
{
    a: {
        b: 10
    }
}
*/

It tries to predict type of created object. For instance, when path contains number, array will be created:
const updated = set({}, 'a.0', 1);

/*
{
    a: [ 1 ]
}
*/

To prevent further accidental mutation all operations returns frozen updated object.
const updated = set(source, 'b.b1', 6);

updated.b.b1 = 10;      // updated.b.b1 still has value of 6

Partial application
All operations supports partial application - when object arguments is not provided, operation returns update function:
const setB1to6 = set('b.b1', 6);

const updated = setB1to6(state);  // equal to set(state, 'b.b1', 6);

When partial application is used, updated object should be passed last:
const setB1 = set('b.b1');
const setB1to6 = setB1(6);      // equal to set('b.b1', 6);

There are several helpful functions provided to make work with partially applied operations easier:

apply(object, ...ops)
pipe(object, ...ops)

src/operations/set/.body:
set(object, path, value)
set() function consumes 3 arguments:

object to update
path to be updated (array of items or dot-separated string can be provided)
value to set in specified path

import { set } from 'immutable-object-update';

const state = {
    a: {
        a1: 1,
        a2: 2
    },
    b: {
        b1: 3,
        b2: 4
    }
};

const updated = set(state, [ 'b', 'b1' ], 5);

// or

const updated = set(state, 'b.b1', 5);

As a result we will receive new object with structure below:
{
    a: {
        a1: 1,
        a2: 2
    },
    b: {
        b1: 3,
        b2: 5
    }
}

src/operations/update/.body:
update(object, path, updater)
Sometimes we need to set new value depends on previous value. Here update() operation can help. It consumes 3 arguments:

object to update
path to be updated (array of items or dot-separated string can be provided)
updater - function to update value on specified path

import { update } from 'immutable-object-update';

const state = {
    a: {
        a1: 1,
        a2: 2
    },
    b: {
        b1: 3,
        b2: 4
    }
};

const increment = oldValue => oldValue + 1;
const updated = update(state, [ 'b', 'b1' ], increment);

// or

const updated = update(state, 'b.b1', increment);

As a result we will receive new object with structure below:
{
    a: {
        a1: 1,
        a2: 2
    },
    b: {
        b1: 4,
        b2: 5
    }
}

src/operations/remove/.body:
remove(object, path)
set() and update() functions can help with new values, but it requires to many steps to remove items. Here remove() operation comes.
remove() function consumes 3 arguments:

object to update
path of item to be removed (array of items or dot-separated string can be provided)

import { remove } from 'immutable-object-update';

const state = {
    a: {
        a1: 1,
        a2: 2
    },
    b: {
        b1: 3,
        b2: 4
    }
};

const updated = remove(state, [ 'b', 'b1' ]);

// or

const updated = remove(state, 'b.b1');

As a result we will receive new object with structure below:
{
    a: {
        a1: 1,
        a2: 2
    },
    b: {
        b2: 5
    }
}

src/functional/apply/.body:
apply(object, ...ops)
apply() function can help to apply several operations at once:

object to update
ops to apply

import { apply, set } from 'immutable-object-update';

const state = {
    a: {
        a1: 1,
        a2: 2
    },
    b: {
        b1: 3,
        b2: 4
    }
};

const setA1to10 = set('a.a1', 10);
const setB1to30 = set('b.b1', 30);

const updated = apply(state, setA1to10, setB1to30);

As a result we will receive new object with structure below:
{
    a: {
        a1: 10,
        a2: 2
    },
    b: {
        b1: 30,
        b2: 5
    }
}

apply() can also apply a list of operations with the same result:
const updated = apply(state, [ setA1to10, setB1to30 ]);

And even many of those:
const updated = apply(state, [ setA1to10, setB1to30 ], [ setCto50 ]);

src/functional/pipe/.body:
pipe(object, ...ops)
pipe() combines several operations into single one to apply later:

object to update
ops to apply

import { pipe, set } from 'immutable-object-update';

const state = {
    a: {
        a1: 1,
        a2: 2
    },
    b: {
        b1: 3,
        b2: 4
    }
};

const setA1to10andB1to30 = pipe(
    set('a.a1', 10),
    set('b.b1', 30)
);

const updated = setA1to10andB1to30(state);

As a result we will receive new object with structure below:
{
    a: {
        a1: 10,
        a2: 2
    },
    b: {
        b1: 30,
        b2: 5
    }
}
